import Draggable from 'vuedraggable' function RevertEventPlugin () {} RevertEventPlugin.prototype = { constructor: RevertEventPlugin, revertGlobal ({ dispatchSortableEvent }) { dispatchSortableEvent('revert') }
} Object.assign(RevertEventPlugin, { pluginName: 'revertEventPlugin'
